import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import ProtectedRoute from './PrivateRoute';
import authService from './authService'; // Replace with your authentication service
import RegistrationForm from './components/register/RegistrationForm';
import LoginForm from './components/login/LoginForm';
import ElectionsReg from './components/electionRegistry/electionRegForm';
import CreateElection from './components/electionCreate/electionCreate';
import CandidateForm from './components/candidateList/candidateForm';
import CandidateAdd from './components/candidateAdd/candidateAdd';
import ParentComponent from './components/electionList/parentComp';

const Home = () => <h2>Home</h2>;
const Dashboard = () => <h2>Dashboard</h2>;
const Logout = () => <h2>Logout</h2>;

const App = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  useEffect(() => {
    const checkAuthentication = async () => {
      const authenticated = await authService.isAuthenticated();
      setIsAuthenticated(authenticated);
    };

    checkAuthentication();
  }, []);

  return (
    <Router>
      <div>
        <Routes>
          <Route path="/" element={<LoginForm />} />
          <Route path="/login" element={<LoginForm />} />
          <Route path="/logout" element={<Logout />} />
          <Route path="/register" element={<RegistrationForm />} />
          {/* Use ProtectedRoute for the protected routes */}
          <ProtectedRoute  path="/dashboard" element={<Dashboard />} />
          <ProtectedRoute path="/electionreg" element={<ElectionsReg />} />
          <ProtectedRoute path="/create" element={<CreateElection />} />
          <ProtectedRoute path="/candform" element={<CandidateForm />} />
          <ProtectedRoute path="/candadd" element={<CandidateAdd />} />
          <ProtectedRoute path="/electionslist" element={<ParentComponent />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
